package date13032012;

public class Comparisonopertor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=10;
		int y=11;
		int z=12;
		System.out.println(x==y);
		Boolean result = x==y;
		System.out.println(result);
		System.out.println(x!=y);
		System.out.println(x>y);
		System.out.println(x<y);
		System.out.println(x>=y);
		System.out.println(x<=z);
		
	}

}
